import "../Dashboard.css";
import favicon from "../images/favicon.ico";

const Paymentheader = () => {
  return (
    <div>
      <div className="uom-image">
        <img src={favicon} alt="firespot" />
      </div>
      <div className="text-header">
        <h2>UOM Payment Management System</h2>
      </div>
      <div>
        <button className="secure-button">Secure Payment</button>
      </div>
      <div><h1>Get the All Payments Ready in a Second</h1></div>
    </div>
  );
};

export default Paymentheader;
